import DataTable from 'react-data-table-component';
import { Link } from 'react-router-dom';
import Employee from './Employee';

const columns = [
    {
        name: 'First Name',
        selector: row => row.firstName,
        sortable: true,
    },
    {
        name: 'Last Name',
        selector: row => row.lastName,
        sortable: true,
    },
    {
        name: 'Edit',
        accessor: "id",
        Cell: ({cell}) => (<Employee employeeId={cell.row.values.id} />) 
    }
];

const data = [
    {
        id: 1,
        firstName: 'Nick',
        lastName: 'MacRoy',
        year: '1995',
    },
    {
        id: 2,
        firstName: 'Nick',
        lastName: 'MacRoy',
        year: '1995',
    },
]

const Employees = () => {
    return (
        <DataTable
            columns={columns}
            data={data}
        />
    );
}

export default Employees
